import "./App.css";
import {motion} from "framer-motion";
import React from "react";

function App() {
  const [rotate, setRotate] = React.useState(false);
  return (
    <div className="App">
      <motion.button 
      animate ={{rotate: rotate ? 360: 0}} 
      onClick= {() => {setRotate(!rotate)}}
      >Explore</motion.button>
    </div>
  );
}

export default App;
